import React from 'react';

function LandingPage() {
  const [message, setMessage] = React.useState('Welcome to Webiste');
  React.useEffect(() => {
    setTimeout(() => {
      setMessage('Thank`s for coming here');
    }, 10000);
  });
  return (
    <div>
      <div className="App-header">{message}</div>
    </div>
  );
}

export default LandingPage;
